// our services menu js
$(document).click(function(t){
  $target = $(t.target);
  $secondaryNav = $('.webViewMenuShow1');

  if($target.hasClass('webViewMenuShow1') || $target.hasClass('openServiceMenu')){
    if(!$secondaryNav.is(':visible')){
      $secondaryNav.slideDown('fast');
    }
    else{
      $secondaryNav.slideUp('fast'); 
    }
  }
  else{
     $secondaryNav.slideUp('fast'); 
  }
});
